"202667":{"id":"202667","name":"O Segundo Melhor Hospital da Galáxia","slug":"o-segundo-melhor-hospital-da-galaxia","original_title":"The Second Best Hospital in the Galaxy","overview":"Doutoras Sleech e Klak enfrentam um caso altamente perigoso e potencialmente revolucionário, e ao fazerem isso, colocam a existência em perigo. Mas considerando suas vidas deprimentes, o esquecimento pode ser uma melhoria.","first_air_date":"2024-02-22","episode_run_time":0,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Cirocco Dunlap"],"production_companies":["Animal Pictures","Titmouse","Amazon MGM Studios"],"genres":["Animação","Sci-Fi & Fantasy","Comédia"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/awlSynWtOKzlI0a8kxABfDkpzex.jpg","poster_path":"https://image.tmdb.org/t/p/original/f8vaJ4qebq7icuQij2CRCXCkabG.jpg","cast":["Stephanie Hsu","Keke Palmer","Maya Rudolph","Kieran Culkin","Sam Smith"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/f8vaJ4qebq7icuQij2CRCXCkabG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/f8vaJ4qebq7icuQij2CRCXCkabG.jpg","air_date":"2024-02-22","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Às Vezes as Cabeças Quebram","overview":"Sleech e Klak realizam uma cirurgia envolvente, perigosa e muito ilegal.","air_date":"2024-02-22","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/bos87NA9PAhkGYb744P8dLzVxOQ.jpg","vote_average":0},"2":{"name":"A Terra do Sexo e da Morte","overview":"Sleech e Plowp lidam com um paciente prestes a explodir. Fora do hospital, Klak lida com sua mãe, uma situação mais estressante do que um paciente explodindo.","air_date":"2024-02-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fT42evAaXcbdThmvZFS4uFliwPv.jpg","vote_average":0},"3":{"name":"A Morte de Amanhã é Problema de Ontem","overview":"Sleech e Klak tratam um capitalista de risco com uma doença temporal ilícita e um visual incrível.","air_date":"2024-02-22","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kvPinvZE0RBp9aIhakCimfFXTAb.jpg","vote_average":0},"4":{"name":"A Maldição de Orlosh","overview":"Uma infecção sexualmente transmissível se espalha rapidamente pelo hospital cheio de tesão.","air_date":"2024-02-22","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/5WvIAHwnNR70cfjXV5LrpwgYmJn.jpg","vote_average":0},"5":{"name":"Chefe-Esturjão Sleech","overview":"Uma médica surpreendente é escolhida como cirurgião-chefe temporária! Klak desenvolve uma nova paixão, e Matt embarca numa busca sensual por membros alienígenas.","air_date":"2024-02-22","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/ppmngirY7xRxelMuyS4P1LgPoGE.jpg","vote_average":0},"6":{"name":"É Ciência, Amore!","overview":"Feliz Dia de São Cthonk! (O \"São\" vem de \"Santo Cientista\"). Enquanto Sleech e Matt passam inesperadamente o feriado juntos, Klak faz algo igualmente festivo: uma autópsia.","air_date":"2024-02-22","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/3lRpaQM6r2PwClqHkamg2RGfr4b.jpg","vote_average":0},"7":{"name":"Só Mais Um Ajuste","overview":"A galáxia assiste enquanto Sleech tenta salvar Klak dela mesma. Sem relação, Matt e Plowp choram bastante.","air_date":"2024-02-22","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/k5pAh9JeHV4V9oDX01Ss8hC2bQi.jpg","vote_average":0},"8":{"name":"O Apocalipse Te Deixou Deprê?","overview":"Sleech e Klak tentam salvar o mundo e acabam dentro de um trato digestivo surpreendentemente espaçoso.","air_date":"2024-02-22","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/oODY5Zw8cpeHcCGpBNe0EXHItle.jpg","vote_average":0}}}}},
