"234800":{"id":"234800","name":"Uma Maldição de Família","slug":"uma-maldicao-de-familia","original_title":"Curses!","overview":"Os Vanderhouven são uma família típica...exceto por uma maldição que recentemente transformou Alex—um amoroso marido e pai—em pedra. A fim de salvá-lo, sua esposa e filhos partem em aventuras arrepiantes para devolver artefatos antigos roubados por um ancestral.","first_air_date":"2023-10-26","episode_run_time":25,"vote_average":6.6,"number_of_seasons":2,"number_of_episodes":20,"created_by":["Jim Cooper","Jeff Dixon"],"production_companies":["DreamWorks Animation","DreamWorks Animation Television","Sunday Night Productions"],"genres":["Animação","Kids","Action & Adventure","Sci-Fi & Fantasy","Família"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/CJ9XvdlBQVXOhH7wHb64OHmzbq.jpg","poster_path":"https://image.tmdb.org/t/p/original/xDa3YxGZtAcSvLRQYAStyfPKbWx.jpg","cast":["Andre Robinson","Gabrielle Nevaeh Green","Lyric Lewis","Reid Scott","Rhys Darby"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3aQ7uDlq80n5Wc2vNBxEA80RsC8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3aQ7uDlq80n5Wc2vNBxEA80RsC8.jpg","air_date":"2023-10-26","episode_count":10,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"A ala restrita","overview":"Quando Alex não volta de um jogo de esconde-esconde, segredos são revelados sobre o passado, presente e futuro dos Vanderhouven.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/cYYJKoJRZMfbH8ZvOPEpHnwRvy3.jpg","vote_average":7},"2":{"name":"A cabeça de babuíno dourada","overview":"Pandora, Russ e Sky fazem amizade com dois aliados improváveis— Stanley e Larry— enquanto correm contra o tempo para capturar uma criatura à solta na mansão.","air_date":"2023-10-26","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/xpcpbWL0zlp4TnqLWIT1HUoLo6C.jpg","vote_average":7},"3":{"name":"O templo dos babuínos","overview":"Os Vanderhouven saem de casa em busca de respostas sobre um artefato amaldiçoado do Congo. Mas, ao chegarem, enfrentam um caos inesperado.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/trdHVHtILp1lVTVoYG0X3Y1RyjR.jpg","vote_average":7},"4":{"name":"Os bebês Olmecas","overview":"Quando três estátuas de fertilidade ganham vida, cabe a Russ, Pandora e Sky reuní-las com sua \"mãe\" em exibição no Museu Paxton.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kRvNN6GoqkyKarAWOCzVcT3DeBv.jpg","vote_average":7},"5":{"name":"A bacia de escriação","overview":"Os Vanderhouven descobrem uma possível maneira de entrar em contato com Alex. Mas o caos continua—e Stanley fica preso no centro de tudo.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/jg85IzDmK4uLr2SYRVYQrhvwdUh.jpg","vote_average":7},"6":{"name":"A pintura japonesa","overview":"Russ, Sky, Stanley e Larry navegam em uma nova crise depois que Pandora é sugada para uma obra de arte e fica cercada por espíritos sinistros.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/glIOS0KdEmrDfipjJmtBhEdYHRR.jpg","vote_average":7},"7":{"name":"O manto celta","overview":"Os Vanderhouven viajam para uma ilha escocesa tempestuosa e cruzam com uma habitante intrigante. Larry e Stanley colocam suas habilidades de criação de mapas à prova.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/qdzfNcVRxWPeTPSX5AsnlO1EkiE.jpg","vote_average":7},"8":{"name":"A caixa de memória","overview":"Para chegar mais perto de salvar Alex, a família deve explorar as memórias de Cornelius Vanderhouven.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kw9h8UT54e2y1uEz3NzQEsBtHSr.jpg","vote_average":7},"9":{"name":"O colar Asteca","overview":"Pandora, Russ e Sky vão para as selvas do Yucatán em busca de uma poderosa bruxa que pode estar em posse de um amuleto protetor.","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/xkXGCwJUF5DJNDogPYfvBaiH06u.jpg","vote_average":7},"10":{"name":"A ampulheta de rubi e a esfera de obsidiana","overview":"Um grande desafio leva os Vanderhouven ao limite. Eles conseguirão superar o impossível e, finalmente, trazer Alex de volta?","air_date":"2023-10-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/7Aoyqfvcx5vQe3Sk8lE1qrJskVo.jpg","vote_average":8}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/xDa3YxGZtAcSvLRQYAStyfPKbWx.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/xDa3YxGZtAcSvLRQYAStyfPKbWx.jpg","air_date":"2024-10-03","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A lanterna","overview":"Os Vanderhouvens viajam para a Transilvânia e cavam mais fundo em uma fonte de luz com poderes sombrios.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/e00IUdMKgvNIQZw7V8P1tFGnce0.jpg","vote_average":0},"2":{"name":"O dado persa","overview":"Quando uma maldição interrompe a noite de jogo de Pandora, uma mantícora invade a festa e apresenta um conjunto de desafios arriscados.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/lBPzHM2pybYcVorpmEqEXMe1Lgl.jpg","vote_average":0},"3":{"name":"O leme do navio otomano","overview":"Larry lidera uma missão para honrar o pedido final de um almirante—mas sua fiel tripulação enfrenta o caos no Mar Egeu.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/fX7TZ5S9Sgcky7ZkE3jqdNBLktt.jpg","vote_average":0},"4":{"name":"A marionete Rajastani","overview":"Os Vanderhouvens embarcam em uma viagem de emergência à Índia quando uma marionete ameaçadora assume o controle de Russ.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/4o1OUmGSsZXjVfC9jPVvfHQryA5.jpg","vote_average":0},"5":{"name":"Os óculos inuítes e a cabaça peruana","overview":"Sussurros estranhos e rodopiantes percorrem a casa enquanto os Vanderhouvens procuram um possível intruso.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/lzfaB5C3mPtOj7PxXSWUcXLQyCr.jpg","vote_average":0},"6":{"name":"O freio Goodluck","overview":"A família vai para o Novo México depois que um artefato do Velho Oeste reacende uma gangue vingativa de espíritos de cowboy.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/bQjGpihDPm6JI9J2gjAFz4Q8iCf.jpg","vote_average":0},"7":{"name":"O Didgeridoo","overview":"Stanley se junta à família em uma aventura na Austrália, onde eles desvendam a surpreendente história de um instrumento musical amaldiçoado.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/iIDBh9b7kSUZnwXlqBZS3DmcLnM.jpg","vote_average":0},"8":{"name":"Tônico de força do Doutor Fantástico","overview":"Depois que uma bebida misteriosa encolhe as crianças Vanderhouven, elas correm para escapar de Linda, o lagarto fêmea, que pensa que são comida.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kn1HRMyWMZ3oSXtChlhdJinxqsC.jpg","vote_average":0},"9":{"name":"Os Escaravelhos Azuis","overview":"Sky e as crianças enfrentam uma crise que põe em risco a Ala Restrita—e descobrem uma verdade horrível sobre Alex.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/4BKA8TvIPkDMOfYcIe9G9JR8vDW.jpg","vote_average":0},"10":{"name":"O trono de Sargão","overview":"Um vilão do passado invade o Museu Paxton e tenta assumir o controle de Alex para sempre.","air_date":"2024-10-03","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/xdtGNNr5pDexBSDju6Eu0F4ai9I.jpg","vote_average":0}}}}},
